private byte[] computeMD5(List<File> files) throws IOException, NoSuchAlgorithmException {
  MessageDigest md5 = MessageDigest.getInstance("MD5");
  for (File file : files) {
    getLog().debug("Computing MD5 for: " + file);
    md5.update(readFile(file));
  }
  return md5.digest();
}
